import { useState } from "react";
import Button from "react-bootstrap/Button";

export default function App() {
  const [boob, setBoo] = useState("nay");

  function handle() {
    fetch('http://192.168.1.104:8000/get/?format=json', { 'mode': 'no-cors' })
      .then(res => res.text())
      .then(res => setBoo(res));
  }

  return (
    <div className="App">
      <header className="App-header">
        <p>
          {boob}
        </p>
      </header>
      <Button variant="danger" onClick={handle}>button</Button>
    </div>
  );
}
